import React from "react";
import Note from "./note";
const NoteList = () => {
  const notes = [
    { id: 1, title: "Note 1", description: "Pierwsza notka" },
    { id: 2, title: "Note 2", description: "Druga notka" },
    { id: 3, title: "Note 3", description: "Trzecia notka" },
    { id: 4, title: "Note 4", description: "Czwarta notka" },
    { id: 5, title: "Note 5", description: "Piąta notka" },
    { id: 6, title: "Note 6", description: "Szósta notka" },
  ];

  return (
      <div className="flex flex-col items-center min-h-screen bg-gray-100 py-8">
        <div className="max-w-4xl w-full grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {notes.map((note) => (
              <Note key={note.id} title={note.title} description={note.description} />
          ))}
        </div>
      </div>
  );
};

export default NoteList;
